import React from "react"

import PlaceList from "../components/PlaceList"


const UserPlaces = () => {
    const DUMMY_PLACE = [
        {
            id: "p1",
            title: "Stone Mountain Park",
            description: "One of Georgia's most popular attractions, a quartz monzonite dome surrounded by 3,200 acres of natural beauty",
            imageUrl: "https://img1.10bestmedia.com/Images/Photos/6617/p-StoneMountain_55_660x440_201404181445.jpg",
            address: "1000 Robert E Lee Blvd, Stone Mountain, GA 30083",
            locationcoordinates: {
                lat: 33.8053189,
                lng: -84.1477202
            },
            creator: "u1"
        },

        {
            id: "p2",
            title: "Stone Mountain Park",
            description: "One of Georgia's most popular attractions, a quartz monzonite dome surrounded by 3,200 acres of natural beauty",
            imageUrl: "https://www.google.com/maps/place/Stone+Mountain+Park/@33.8053189,-84.1455315,3a,75y/data=!3m8!1e2!3m6!1sAF1QipMKb0BAwnlvuQjcHEMRv0rvBVLk637O6P5ab5o5!2e10!3e12!6shttps:%2F%2Flh5.googleusercontent.com%2Fp%2FAF1QipMKb0BAwnlvuQjcHEMRv0rvBVLk637O6P5ab5o5%3Dw114-h86-k-no!7i12000!8i9000!4m5!3m4!1s0x88f5af93226febdf:0x6f81f2995d35185c!8m2!3d33.8053189!4d-84.1455315?hl=en#",
            address: "1000 Robert E Lee Blvd, Stone Mountain, GA 30083",
            locationcoordinates: {
                lat: 33.8053189,
                lng: -84.1477202
            },
            creator: "u2"
        }


    ]

    return (
        <PlaceList item={DUMMY_PLACE} />
    )
}

export default UserPlaces
